from itertools import product
def p(i, w): return len(set(w[j:j+i] for j in range(len(w)-i+1)))
def scp(w): return tuple(p(i, w) for i in range(1, len(w)+1))
def a(n):
    return len(set(scp("0"+"".join(w)) for w in product("01", repeat=n-1)))
